define({"topics":[{"title":"Put the <span class=\"ph\">Conductor<\/span> into diagnostic mode","shortdesc":"<p class=\"shortdesc\">To place the <span class=\"ph\">Conductor<\/span> into diagnostic     mode, you will need a laptop connected to port 2 that is configured to receive a DHCP IP     Address.<\/p>","href":"content\/topics\/cond_diag_mode.html","attributes":{"data-id":"cond_diag_mode"},"menu":{"hasChildren":false},"tocID":"cond_diag_mode-d8884e13446","topics":[]},{"title":"Put an <span class=\"ph\">Airwall Gateway<\/span> into diagnostic mode","shortdesc":"<p class=\"shortdesc\">With an <span class=\"ph\">Airwall Gateway<\/span>         in diagnostic mode, you can troubleshoot it by collecting diagnostic information and you can         also manage a variety of settings such as IP addresses, logs, and firmware. <\/p>","href":"content\/topics\/aw_diag_mode.html","attributes":{"data-id":"hip_diag_mode"},"menu":{"hasChildren":false},"tocID":"hip_diag_mode-d8884e13463","topics":[]},{"title":"Create a <span class=\"ph\">Conductor<\/span> database backup","shortdesc":"<p class=\"shortdesc\">A <span class=\"ph\">Conductor<\/span>         database backup can provide a measure of security when you are working on system-wide         changes. Before you update firmware or replace hardware, we strongly recommend that you         create, download and archive a <span class=\"ph\">Conductor<\/span> database         backup.<\/p>","href":"content\/topics\/cond_db_backup_proc.html","attributes":{"data-id":"cond_db_backup_proc"},"menu":{"hasChildren":false},"tocID":"cond_db_backup_proc-d8884e13480","topics":[]},{"title":"Restore or replace a <span class=\"ph\">Conductor<\/span> database backup","shortdesc":"<p class=\"shortdesc\"> <\/p>","href":"content\/topics\/cond_db_backup.html","attributes":{"data-id":"cond_db_backup"},"menu":{"hasChildren":false},"tocID":"cond_db_backup-d8884e13500","topics":[]},{"title":"Identify a Physical <span class=\"ph\">Airwall Gateway<\/span>","shortdesc":"<p class=\"shortdesc\">If you need to identify a particular physical <span class=\"ph\">Airwall Gateway<\/span> from the <span class=\"ph\">Conductor<\/span>, you can use             <span class=\"ph\">Conductor<\/span>         Blink.<\/p>","href":"content\/topics\/cond_blink.html","attributes":{"data-id":"cond_blink"},"menu":{"hasChildren":false},"tocID":"cond_blink-d8884e13514","next":"cond_blink-d8884e13514"},{"title":"Collect troubleshooting data for <span class=\"ph\">Airwall Gateways<\/span>, <span class=\"ph\">Conductors<\/span>, or <span class=\"ph\">Airwall Agents and Servers<\/span>","shortdesc":"<p class=\"shortdesc\">How to capture information to assist in troubleshooting different parts of an <span class=\"ph\">Airwall secure network<\/span>.<\/p>","href":"content\/topics\/aw_tbl_top.html","attributes":{"data-id":"aw_tbl_top"},"menu":{"hasChildren":false},"tocID":"aw_tbl_top-d8884e13550","next":"aw_tbl_top-d8884e13550"},{"title":"Update the MAC address (OUI) (Manufacturer) List","shortdesc":"<p class=\"shortdesc\">The OUI (organizationally unique identifier) list is used to map device MACs to         manufacturer names in your <span class=\"ph\"><span class=\"ph uicontrol\">Devices<\/span><\/span> list. If the list         has changed since you installed your <span class=\"ph\">Conductor<\/span>, you can now         update it. <\/p>","href":"content\/topics\/diag_update_oui.html","attributes":{"data-id":"diag_update_oui"},"menu":{"hasChildren":false},"tocID":"diag_update_oui-d8884e13703","topics":[]}]});